demo.repl.help:
उपलब्ध कमांड्स:
  @show              ─ शेवटचा adaptive card सारांश दाखवा
  @json              ─ flow कडून मिळालेली raw JSON value आउटपुट करा
  @back              ─ मागील blocked card/inputs स्थितीवर परत जा
  @input <k>=<v>     ─ input field सेट किंवा override करा
  @click <action_id> ─ दिलेल्या action सह card सबमिट करा
  @help              ─ हा मदत मजकूर छापा
  @quit              ─ REPL मधून बाहेर पडा
